link.script:
AIQUA.init({
  appId: '5f752526166dbbd2a8b5',
  timeout: 5000,
});

!function (q, g, r, a, p, h, js) {
  if (q.qg) return;
  js = q.qg = function () {
    js.callmethod ? js.callmethod.call(js, arguments) : js.queue.push(arguments);
  };
  js.queue = [];
  p = g.createElement(r);
  p.async = !0;
  p.src = a;
  h = g.getElementsByTagName(r)[0];
  h.parentNode.insertBefore(p, h);
}(window, document, 'script', 'https://cdn.qgr.ph/qgraph.5f752526166dbbd2a8b5.js');

div.script:
  window.onload = function(){
    axios.get('https://m.commonhealth.com.tw/ajax-search-record').then(function(res){
      var searchHistoryArea = document.querySelector('div#history-suggest');
      res.data.searchHistory.forEach(function(ele, idx) {
        if(!!ele) {
          var $a = document.createElement('a');
          $a.setAttribute('href', 'https://m.commonhealth.com.tw/search?keyword=' + ele);
          $a.classList = 'tags tags--normal';
          $a.innerText = ele;
          searchHistoryArea.appendChild($a);
        }
      });
    }).catch(console.error);
  }
  $(document).on('click', '#go_search', function(e) {
    e.preventDefault();
    var kw = $('input[name=keyword]').val();
    if (kw.length > 0) {
        Appier.common().keywordSearch(kw, '#searchForm');
    }
});
